import React, { useState, useEffect } from "react";
import { useHistory } from "react-router-dom";

export default function Tickets() {
  const history = useHistory();
  const API_URL = "http://localhost:5000/api/tickets";

  const [ticketList, setTicketList] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchTickets();
  }, []);

  const fetchTickets = async () => {
    try {
      const token = localStorage.getItem("token");
      const response = await fetch(`${API_URL}/all`, { headers: { Authorization: `Bearer ${token}` } });
      const data = await response.json();
      setTicketList(data);
      setLoading(false);
    } catch (error) {
      console.error(error);
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure?")) return;
    try {
      const token = localStorage.getItem("token");
      await fetch(`${API_URL}/delete/${id}`, { method: "DELETE", headers: { Authorization: `Bearer ${token}` } });
      setTicketList(ticketList.filter(t => t.id !== id));
      alert("Ticket deleted successfully");
    } catch (error) {
      console.error(error);
      alert("Failed to delete ticket");
    }
  };

  const filteredTickets = ticketList.filter(ticket =>
    ticket.names?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    ticket.phone?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    ticket.express?.expressName?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  if (loading) return <p className="p-6 text-center">Loading tickets...</p>;

  return (
    <div className="max-w-5xl mx-auto p-6">
      <div className="flex justify-between items-center mb-4">
        <input placeholder="Search tickets..." value={searchTerm} onChange={e => setSearchTerm(e.target.value)} className="border p-2 rounded"/>
        <button onClick={() => history.push("/admin/tickets/add")} className="bg-teal-500 text-white p-2 rounded">Add Ticket</button>
      </div>

      <table className="w-full border-collapse border">
        <thead>
          <tr>
            <th className="border p-2">#</th>
            <th className="border p-2">Name</th>
            <th className="border p-2">Phone</th>
            <th className="border p-2">Express</th>
            <th className="border p-2">Schedule(s)</th>
            <th className="border p-2">Status</th>
            <th className="border p-2">Date</th>
            <th className="border p-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredTickets.map((t, idx) => (
            <tr key={t.id}>
              <td className="border p-2">{idx+1}</td>
              <td className="border p-2">{t.names}</td>
              <td className="border p-2">{t.phone}</td>
              <td className="border p-2">{t.express?.expressName || "-"}</td>
              <td className="border p-2">{t.schedule?.map(s => s.id).join(", ")}</td>
              <td className="border p-2">{t.payState}</td>
              <td className="border p-2">{new Date(t.date).toLocaleDateString()}</td>
              <td className="border p-2 flex space-x-2">
                <button onClick={() => history.push(`/admin/tickets/edit/${t.id}`)} className="bg-blue-600 text-white p-1 rounded">Edit</button>
                <button onClick={() => handleDelete(t.id)} className="bg-red-600 text-white p-1 rounded">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
